<script>
 
  var xhttp = new XMLHttpRequest();
  xhttp.onreadystatechange = function() {
    if (this.readyState == 4 && this.status == 200) {
 
      var myObj = JSON.parse(this.responseText);

      console.log(myObj) ; 

    }
  };
  xhttp.open("GET", "json.json", true);
  xhttp.send();

</script>
 